import React, { Component } from 'react';
import './App.scss';
import DataGeneral from './DataGeneral';
import AppContext from './AppContextProvider'

const data = {"avishai":"Taashur"};
class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      data:data
    };
  }
  render() {
    return (
    <div>
        <div className="App">
            <header className="App-header">
              <h2>Welcome to SEW JSON/HTML Tool</h2>
            </header>
            <AppContext.AppContextProvider.Consumer value={this.state}>
              {(context) => <p>{context.data}</p>}
            </AppContext.AppContextProvider.Consumer>
            <div>
              <DataGeneral />
            </div>
          </div>
       </div>
    );
  }
}

export default App;
